* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

*:before,
*:after {
    box-sizing: border-box;
}

img {
    max-width: 100%;
    min-width: 100%;
}

body {
    background-color: #EEE;
    font-family: "inter";
    overflow-x: hidden;
}

input {
    font-family: "inter";
    font-size: 14px;
    border: 1px solid #DDD;
}

.site-nav>.nav-form {
    display: flex;
    justify-content: space-between;
}

ul,
ol,
ul li,
ol li {
    list-style: none;
}

.ui-loader-default {
    display: none
}

.ui-mobile-viewport {
    border: none;
}

.ui-page {
    padding: 0;
    margin: 0;
    outline: 0
}

li .outWrapper {
    width: 100%;
    height: 100%;
    text-decoration: none;
    display: flex;
    justify-content: center;
    color: inherit;
    position: relative;
}

li .outWrapper .icon-close-wrapper {
    position: absolute;
    right: 8%;
    top: 5%;
    display: none;
}

li:hover .icon-close-wrapper {
    display: block;
    animation: showCloseBtn 0.4s forwards;
}

@keyframes showCloseBtn {
    from {}

    to {
        background-color: #CCC;
    }
}

.guide {
    display: flex;
    margin: 30px 20% 10px 20%;
    justify-content: center;
    font-size: 12px;
}

.searchText {
    width: 100%;
    border-radius: 4px;
}

.searchButton {
    white-space: nowrap;
    border: none;
    background-color: #0282B9;
    border-radius: 4px;
    color: white;
}

.searchButton:hover {
    cursor: pointer;
}

.site-nav {
    display: flex;
    justify-content: center;
}

.site-main {
    display: flex;
    justify-content: flex-start;
}

.siteList {
    display: flex;
    flex-flow: row wrap;
    justify-content: flex-start;
}

.siteList li {
    background-color: #fff;
    border: 1px solid #DDD;
    border-radius: 4px;
    display: flex;
    justify-content: center;
    align-content: center;
    flex-wrap: wrap;
    flex-direction: column;
    user-select: none;
}

.siteList li:hover {
    cursor: pointer;
}

.site-info .addBtnWrapper {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
}

.site-info .logo {
